import React from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import { Link } from "react-router-dom";
import logout from '../../../../back-end/controllers/auth'
import Chat from '../Chat/Chat'


export const Nav = ({selectedCat, onSelect}) => {





    return (
        <Paper>
        <Tabs
            value={selectedCat}
            onChange={(event, index) => {onSelect(index)}}
            indicatorColor="primary"
            textColor="primary"
            centered
        >
            <Tab label="Home" component={Link} to="/"/>
            <Tab label="Chat" component={Link} to="/chat"/>
            <Tab label="log out" onClick={logout} component={Link} to="/"/>

        </Tabs>
        </Paper>
    )
}
